import React from "react";
import { Link } from "react-router-dom";
import "../styles/header.css";

function NavBar() {
    return (
        <header className="site-header">
            <nav className="navbar navbar-expand-md navbar-dark bg-steel fixed-top">
                <div className="container">
                    <Link className="navbar-brand mr-4" to="/">Home</Link>
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggle" aria-controls="navbarToggle" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarToggle">
                        <div className="navbar-nav mr-auto">
                            <Link className="nav-item nav-link" to="/new-deck">New Slide Deck</Link>
                            <Link className="nav-item nav-link" to="/edit-deck">View Existing Slide Deck</Link>
                        </div>
                        {/* Navbar Right Side */}
                        <div className="navbar-nav">
                            <Link className="nav-item nav-link" to="/howto">Present Slide Deck</Link>
                        </div>
                    </div>
                </div>
            </nav>
        </header>
    );
}

export default NavBar;
